import React from 'react';
import './ContactUs.css';
import FrameLayout from '../../frame_layout/FrameLayout';

function ContactUs() {
  return (
      <FrameLayout>
         <h1>
            Contact Us
         </h1>
      </FrameLayout>
  );
}

export default ContactUs;
